export const RECTANGLE = () => {
  return (
    <svg
      style={{
        transform: "translate(0px, 0px) rotate(0deg) scale(1, 1)",
        transformOrigin: "1px 1px",
        position: "absolute",
        top: 0,
        left: 0,
      }}
      width="782"
      height="1024"
      viewBox="0 0 782 1024"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <path
        d="M0 0L782 0L782 1024L0 1024L0 0Z"
        fill="rgba(215.05002290010452, 234.38064962625504, 255, 1)"
      />
    </svg>
  );
};
